// new syntax
function greensockInit3() {
	var el = $('.gsap-new img');
	var anDuration = 8;
	gsap.set(el, {x: "-100%"});
	gsap.to(el, {repeat: -1, ease: "none",duration: anDuration, stagger: anDuration/3, css: {x: "100vw"}});
	gsap.to(el, {repeat: -1, ease: "none",duration: 2, yoyo:true, y: gsap.utils.wrap(["100%","-100%","50%","-50%"]) });
}

