/* module svg-animate */
// function on
jQuery(document).ready(function() {
	TotalSvgLength();
});

// function init
function TotalSvgLength() {

	function svgAn() {
		var path = document.querySelector('.squiggle-animated path');
		var length = Math.round(path.getTotalLength());
		// Clear any previous transition
		path.style.transition = path.style.WebkitTransition = 'none';
		// Set up the starting positions
		path.style.strokeDasharray = length + ' ' + length;
		path.style.strokeDashoffset = length;
		// Trigger a layout so styles are calculated & the browser
		// picks up the starting position before animating
		path.getBoundingClientRect();
		// Define our transition
		path.style.transition = path.style.WebkitTransition = 'stroke-dashoffset 2s ease-in-out';
		// Go!
		path.style.strokeDashoffset = '0';
	}
	svgAn();

	$('.btn-svg').on('click', function() {
		event.preventDefault();
		svgAn();
	});

};

/* module confetti */
// function on
jQuery(document).ready(function() {
	// работает только один пример за раз
	// ptsInit1();
	ptsInit2();
});

// // function init
function ptsInit1() {
	Pts.quickStart("#pt", "#123");
	var pts = [];
	var colors = ["#ff2d5d", "#42dc8e", "#2e43eb", "#ffe359"];
	space.add({
		// init with 500 random points
		start: (bound) => { pts = Create.distributeRandom(space.innerBound, 500); },
		animate: (time, ftime) => {
			let r = Math.abs(space.pointer.x - space.center.x) / space.center.x * 150 + 70;
			let range = Circle.fromCenter(space.pointer, r);
			// check if each point is within circle's range
			for (let i = 0, len = pts.length; i < len; i++) {
				if (Circle.withinBound(range, pts[i])) {
					// calculate circle size
					let dist = (r - pts[i].$subtract(space.pointer).magnitude()) / r;
					let p = pts[i].$subtract(space.pointer).scale(1 + dist).add(space.pointer);
					form.fillOnly(colors[i % 4]).point(p, dist * 25, "circle");
				} else {
					form.fillOnly("#fff").point(pts[i], 0.5);
				}
			}
		}
	});
	space.bindMouse().bindTouch().play();
}

function ptsInit2() {
	Pts.quickStart("#pt2", "#fe3");
	let pts = new Group();
	// Confetti extends Pt to implement custom logic and rendering
	class Confetti extends Pt {
		constructor(...args) {
			super(...args);
			this.color = ["#f03", "#09f", "#0c6", "#fff"][Util.randomInt(4)];
			this.size = Math.random() * 7 + 2;
			this.angle = Math.random() * Const.two_pi;
			this.dir = (Math.random() > 0.5) ? 1 : -1;
			this.shape = ["rect", "circle", "tri"][Util.randomInt(3)];
		}
		render(form) {
			if (this.y < space.size.y) {
				this.y += 2 / this.size + Math.random();
				this.x += Math.random() - Math.random();
				this.angle += this.dir * (Math.random() * Const.one_degree + Const.one_degree);
				if (this.shape == "tri" || this.shape == "rect") {
					let shape = (this.shape == "tri") ? Triangle.fromCenter(this, this.size) : Rectangle.corners(Rectangle.fromCenter(this, this.size * 2));
					shape.rotate2D(this.angle, this);
					form.fillOnly(this.color).polygon(shape);
				} else {
					form.fillOnly(this.color).point(this, this.size, "circle");
				}
			}
		}
	}
	space.add({
		animate: (time, ftime) => {
			// remove confetti if reaching the bottom or too many
			if (pts.length > 1000 || (pts.length > 0 && pts[0].y > space.size.y)) pts.shift();
			// add a confetti every second
			if (Math.floor(time % 1000) > 980) pts.push(new Confetti(space.pointer));
			// render the confetti
			pts.forEach(p => p.render(form));
		},
		action: (type, px, py) => {
			// add a point to the line when mouse moves
			if (type == "move") pts.push(new Confetti(px, py));
		}
	});
	//// ----
	space.bindMouse().bindTouch().play();
}

