/* module snap-svg */
// function on
jQuery(document).ready(function() {
	snapSvg();
	snapSvg2();
	snapSvg3();
});

// function init
// more option http://snapsvg.io/docs/
function snapSvg() {
	var s = Snap(".snap-svg")
	var bigCircle = s.circle(300, 150, 100)
	bigCircle.attr({
		fill: "#bada55",
		stroke: "#000",
		strokeWidth: 5
	})
	var smallCircle = s.circle(250, 150, 40);
	var discs = s.group(smallCircle, s.circle(400, 150, 80));
	discs.attr({
		stroke: "#000",
		strokeWidth: 1,
		fill: "#eee"
	});
	smallCircle.animate({ r: 80 }, 1000);
	discs.select("circle:nth-child(2)").animate({ r: 40 }, 1000);
	bigCircle.animate({ r: 80 }, 1000);
}

function snapSvg2() {
var svg = document.getElementById("cups");
var s = Snap(svg);

var simpleCup = Snap.select('#simple-cup');
var fancyCup = Snap.select('#fancy-cup');

var simpleCupPoints = simpleCup.node.getAttribute('d');
var fancyCupPoints = fancyCup.node.getAttribute('d');


var toFancy = function(){
  simpleCup.animate({ d: fancyCupPoints }, 1000, mina.backout, toSimple);
}

var toSimple = function(){
  simpleCup.animate({ d: simpleCupPoints }, 1000, mina.backout, toFancy);
}

toSimple();
}

// more info see https://www.youtube.com/watch?v=2N1MP44OvN8&list=PLswdBLT9llbjS2o4xreJqgBRjTmkEz6sv&index=36&t=3326s
