// function init
// more option https://momentjs.com/
function momentJsInit() {

	var now = moment().format('MMMM Do YYYY, h:mm:ss a');
	$('.moment-js-now').text(now);

	var Relative = moment().endOf('day').fromNow();
	$('.moment-js-Relative').text(Relative);

	var Calendar = moment().add(3, 'days').calendar();  ;
	$('.moment-js-Calendar').text(Calendar);

}

