/* module hyphenationsWord */
// function on
jQuery(document).ready(function() {
	hyphenationsWordInit();
});
// function init
function hyphenationsWordInit() {
	$('.hyphenations-text').hyphenate();
}

$.fn.hyphenate = function() {
  var all = "[абвгдеёжзийклмнопрстуфхцчшщъыьэюя]",
    glas = "[аеёиоуыэю\я]",
    sogl = "[бвгджзклмнпрстфхцчшщ]",
    zn = "[йъь]",
    shy = "\xAD",
    re = [];

  re[1] = new RegExp("("+zn+")("+all+all+")","ig");
  re[2] = new RegExp("("+glas+")("+glas+all+")","ig");
  re[3] = new RegExp("("+glas+sogl+")("+sogl+glas+")","ig");
  re[4] = new RegExp("("+sogl+glas+")("+sogl+glas+")","ig");
  re[5] = new RegExp("("+glas+sogl+")("+sogl+sogl+glas+")","ig");
  re[6] = new RegExp("("+glas+sogl+sogl+")("+sogl+sogl+glas+")","ig");
  return this.each(function() {
    var text = $(this).html();
    for (var i = 1; i < 7; ++i) {
      text = text.replace(re[i], "$1"+shy+"$2");
    }
    $(this).html(text);
  });
};

/* module watterRipples */
// function on
jQuery(document).ready(function() {
	watterRipplesInit();
});

// more option https://github.com/sirxemic/jquery.ripples/
// function init
function watterRipplesInit() {
	jQuery(".watter-ripples").ripples({
		resolution: 512,
		dropRadius: 20,
		perturbance: 0.04,
	});
}

